function get_home_url(){var t=window.location;return t.origin+"/"}function get_url_path(){for(var t=window.location,a=t.pathname.split("/"),e="",n=0;n<a.length;n++)a[n]&&(e=e+"/"+a[n]);return e}function stag_activate_menu(){$(".nav-menu a").each(function(t,a){var e=$(a),n=get_url_path();if(""==n||"/index.html"==n)$("#home").addClass("active");else if(e.attr("href")==n)e.addClass("active");else{var o=n.split("/");$("#"+o[1]).addClass("active")}})}function stag_load_template(){var t=new Date;$("[data-load-template]").each(function(a,e){let n=$(e);$.ajax({url:get_home_url()+"/"+n.data("load-template")+".data?time="+t.getSeconds()}).done(function(t){n.html(t),"navigation"==n.data("load-template")&&stag_activate_menu()})})}function functionSequence(){stag_load_template()}window.addEventListener?window.addEventListener("load",function(){functionSequence()}):window.attachEvent("onload",function(){functionSequence()});